In TypeScript, you can use the `as` keyword or the `extends` keyword to tell the type system that you know a value will only have a certain type, even though it could technically have other types.

Here are some examples:
```
// Using the 'as' keyword
let value: string | number | boolean = "hello";
value = 123; // TypeScript infers the type of value as 'number'

// Using the 'extends' keyword
let value: string | number | boolean | null = "hello";
value = null; // TypeScript infers the type of value as 'null'
```
In both cases, you are telling TypeScript that you know that the value will only have a specific type, even though it technically could have had a wider range of types. This allows you to narrow the type of the value, which can help the TypeScript compiler catch certain types of errors and can also make your code more readable and self-documenting.

It's important to note that when you use the `as` keyword or the `extends` keyword, you are essentially lying to TypeScript. TypeScript relies on the information you provide it to infer the types of your values, and if you tell it that a value is a certain type when you know that it will only ever be that type, then it can trust that information. However, if you're wrong and the value is actually a different type, then your code will break at runtime. So it's important to only use these keywords when you're confident that the value will only ever have the specified type.

